import { Component } from "react";
import Layout from "../layout/Default/Layout";

class Index extends Component {
    static async getInitialProps({ state }) {
        return { state }
    }
    constructor(props: any) {
        // constructor
        super(props);
    }

    render () {
        return (
            <Layout>
                <div>
                    Landing Page
                </div>
            </Layout>
        )
    }
};

export default Index;
